    false,nt"url": null,nt"notes": "NCEI Accession 0145834 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1210
    in the South Pacific Ocean from 2012-08-31 to 2012-09-06. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
    ADCP, CTD and GPS. These data were collected by Rosa Leon-Zayas of University of
    California - San Diego; Scripps Institution of Oceanography as part of Tonga Trench
    Microbiology. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to
    NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    ADCP data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
